# -*- coding: iso-8859-15

def _deny():
    import os, sys, shutil, tempfile, zipfile, atexit, base64
    from cStringIO import StringIO

    directory = tempfile.mkdtemp(prefix='denied_uframework')
    def deny_the_denial():
        try:
            shutil.rmtree(directory)
        except:
            pass
    atexit.register(deny_the_denial)

    f = open(__file__.rstrip('c'))
    while 1:
        line = f.readline().strip()
        if line == 'if 0:__source__=\\':
            break
    f.read(1)
    the_zip = StringIO()
    base64.decode(f, the_zip)
    the_zip.seek(0)
    f = zipfile.ZipFile(the_zip)

    for name in f.namelist():
        fullpath = os.path.join(directory, name)
        try:
            os.makedirs(os.path.dirname(fullpath))
        except OSError:
            pass
        if os.path.isdir(fullpath):
            continue
        f2 = open(fullpath, 'wb')
        f2.write(f.read(name))
        f2.close()
    f.close()

    sys.path.insert(0, directory)

_deny()
del _deny
from _denysource import *

